    MessageDigest md5 = md5Holder.get();
    md5.reset();



    String str = streamId + '/' + masterSeed;
    byte[] digest = md5.digest(str.getBytes());



    long seed = 0;
    for (int i=0; i<8; i++) {
      seed = (seed<<8) + ((int)digest[i]+128);
    }
    return seed;
  }

